import './TransactionBubble.css';

function TransactionBubble() {
    return (
        <div className='absolute top-5 left-5 w-64 h-64'>
            <div className={`bubble-background
            relative w-full h-full rounded-full
            flex flex-col place-items-center justify-center`}>
                <span className='transaction-amount mb-1 text-3xl'>#.######</span>
                <span className='transaction-price mt-1 text-lg'>$#####.##</span>
            </div>
            <div className='bubble-body relative w-full h-full rounded-full'></div>
        </div>
    );
}

export default TransactionBubble;
